:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Caroline Elizabeth and LUDBROOK, Samuel Blomfield
  JLUDBROOK, Henry Samuel (Harry) and KINSELLA, Hana
  VLUDBROOK, Kenneth William and BANKS, Barbara Susan (Tosti)
  VLUDBROOK, Sally June and COVENTRY, Richard Donald
  03> LUDBROOK, Sally June m on 15.05.1965 to COVENTRY, Richard Donald
  b 03.06.1942
  b 22.12.1941
  Sally b. at Taiamai and m. at Paihia. Richard, slo Donald Carmichael Coventry and Marie Taylor, b. at
  Matangi, Hamilton. Address: 34 Anglesea Street, Hamilton.
  Sally was educated at Cambridge High School and graduated as a nurse in 1963. She represented Waikato
  at swimming.
  Richard was educated at St Kentigern's School, Auckland and is an orchardist. He played representative
  rugby for Waikato in the 1960's. His other interests include tennis, cricket and rowing.
  01> COVENTRY, Tom James m on 14.12.1991 to HANSON, Kerrin
  b 24.11.1965
  b 21.07.1965
  Tom was educated at Hamilton Boys' High School and Otago University (Phys Ed). He was captain of
  the Otago and New Zealand Universities rugby teams and is currently a Waikato rugby rep. Tom is a
  physical education teacher at Hamilton Boys' High School and Kerrin is a physical education teacher
  at Fairfield College, Hamilton.
  01> COVENTRY, Laura Jane
  b 27.08.1994
  02> COVENTRY, Joseph Rhys
  b 30.05.1996
  02> COVENTRY, William Michael m on ** ** **** to HANNEN, Lynley
  b 26.01.1967
  b 27.08.1964
  William was educated at Hamilton Boys' High School and is a carpenter. He represented New Zealand
  and Waikato at rowing. He was a member of the New Zealand rowing team at the Olympic Games in Seoul
  in 1988 and a bronze medalist at the World Championships in Yogoslavia in 1989. William is a member
  of the current Olympic squad which is training for the next Olympic Games in Barcelona. His other
  interests are tennis and cricket.
  01> COVENTRY, Samuel Hannen
  b 09.11.1994
  02> COVENTRY, Alexander William
  b 14.11.1996
  63> COVENTRY, Richard Andrew m on ** ** **** to COWLEY, Lisa
  b 13.02.1970
  b 04.08.1968
  Richard was educated at Hamilton Boys' High School. He was in the 1st rugby XV for three years and
  played for Northern Region Secondary Schools in 1988. He subsequently represented Waikato in every
  age group up to the Waikato Development Squad. His other interests include rowing in which he was a
  member of the Waikato and New Zealand Colts and Junior teams. Representing Waikato, he was a member
  of the team which won eight New Zealand titles. As a schoolboy he was a member of the 1987 rowing
  team which won the Maadi Cup. Richard is an accountant.
